function startup(){let pagenavigator=document.getElementById("pagenavigator");if(null===pagenavigator)return void console.info("No container PageNavigatorJS");let headersTags=document.querySelectorAll("h2, h3, h4, h5, h6"),lastNumberTag;if(0===headersTags.length)return void console.info("No headers");let content="<ul>";headersTags.forEach((function(item,i,headersTags){if(""!==item.id){let hNumber=parseInt(item.tagName.slice(1));if(0==i)content+='<li><a href="#'+item.id+'">'+item.innerText+"</a></li>";else if(lastNumberTag===hNumber)content+='<li><a href="#'+item.id+'">'+item.innerText+"</a></li>";else if(hNumber>lastNumberTag){let nesting=hNumber-lastNumberTag;for(let i=0;i<nesting;i++)content+="<li><ul>";content+='<li><a href="#'+item.id+'">'+item.innerText+"</a></li>"}else if(hNumber<lastNumberTag){console.log(lastNumberTag+"\t"+hNumber);for(let i=0;i<lastNumberTag-hNumber;i++)content+="</ul></li>";content+='<li><a href="#'+item.id+'">'+item.innerText+"</a></li>"}lastNumberTag=hNumber}else console.log("Header no find id"+item.tagName+item.innerText)})),content+="</ul>",pagenavigator.innerHTML=content,console.log(content)}window.addEventListener("DOMContentLoaded",startup());